        function initJSMEdepictions() {
            let molecules = smirks.split('\n');
            let perrow = 2; // 3 items per row
            let html = "<table><tr>";
            // Loop through array and add table cells
            for (var i = 0; i < molecules.length; i++) {

                let smirks = molecules[i].split(/\s+/)[0];
                html += '<td>' + (i+1) + '</td>';

                let jsmeInsert = '<div code="JME.class" archive="JME.jar" width=480\n' +
                    'height=240>\n' +
                    '<param name="options" value="depict,toggle">\n' +
                    '<param name="chem"\n' +
                    'value="' + smirks + '"\n'
                    + '</div>';
                html += '<td>' + jsmeInsert + '</td>';
                // Break into next row
                var next = i + 1;
                if (next % perrow === 0 && next !== molecules.length) {
                    html += "</tr><tr>";
                }
                //console.log(smirks);

                if( i === 10) {
                   // break;
                }

            }
            html += "</tr></table>";
            // ATTACH HTML TO CONTAINER
            document.getElementById("container").innerHTML = html;
            console.log('Onload completed');

        }


        function jsmeOnLoad() {
            console.log('jsmeOnLoad');
            initJSMEdepictions();
            //JSApplet.JSME.replaceAllAppletsByJSME();
            JSApplet.JSME.replaceAllAppletsByJSME(() => document.getElementById("loading-bar").innerHTML = '');
        }


    </script>
